declare const _default: (theme: any) => {
    root: {
        padding: string;
        '&:first-child': {
            paddingLeft: number;
        };
        '&:last-child': {
            paddingRight: number;
        };
        'th&': {
            whiteSpace: string;
            fontWeight: string;
            borderBottom: string;
        };
    };
};
export default _default;
